import React from "react"

export default function CreatedMeme(props) {
    return(
        <div className="preview--meme">
            <img className="preview--meme--image" src={props.item.randomImage}/>
            <h2 className="preview--meme--text top">{props.item.topText}</h2>
            <h2 className="preview--meme--text bottom">{props.item.bottomText}</h2>
        </div>
    )
}
